import React from "react";
import "./RocketCard.css"; // Підключення стилів для картки
import leftButton from "./images/left_button.svg"; // Оновлений шлях
import rightButton from "./images/right_button.svg"; // Оновлений шлях

const RocketCard = ({ rocket, onPrevious, onNext }) => {
  return (
    <div className="rocket-card">
      <div className="rocket-card__image">
        <img src={rocket.image} alt={rocket.name} />
      </div>

      <div className="rocket-card__info">
        <h2>{rocket.name}</h2>
        <p>
          <strong>Manufacturer:</strong> {rocket.manufacturer}
        </p>
        <p>
          <strong>Country:</strong> {rocket.country}
        </p>
        <p>
          <strong>Mission Count:</strong> {rocket.missionCount}
        </p>
        <p>{rocket.description}</p>
      </div>

      {/* Кнопки перемикання */}
      <button id="left_button" className="btn" onClick={onPrevious}>
        <img src={leftButton} alt="Previous" />
      </button>

      <button id="right_button" className="btn" onClick={onNext}>
        <img src={rightButton} alt="Next" />
      </button>
    </div>
  );
};

export default RocketCard;
